import React from "react";
//import { NavLink } from "react-router-dom";
import CommonParent from "./CommonParent";
import Emoji from "react-native-emoji";
import web from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/spaceship.gif";
const Home = (props) => {
  return (
    <div id="home" className=" #home">
      <CommonParent
        // name="Hello! my name is "
        imgsrc={web}
        visit="/projects"
        btname="View Projects"
      >
        <p>
          Hello! My name is Maah Asghar. I am a Software Engineer based in
          London, Ontario, Canada
        </p>
        <Emoji name="flag_ca" />
      </CommonParent>

      {/* <CommonParent
        name="Hello! my name is "
        imgsrc={web}
        visit="/projects"
        btname="View Projects"
      /> */}
    </div>
  );
};

export default Home;
